Prerequisites:
Prerequisites Completion of a minimum of 50 credit points of Graduate level Computing and Information Systems subjects with a Weighted Average Mark (WAM) of at least 70 The 50 points excludes:
 COMP90007 Internet Technologies;
 COMP90038 Algorithms and Complexity;
 COMP90041 Programming and Software Development;
 SINF90001/INFO90002 Database Systems and Information Modelling. If you meet this criteria please complete an Enrolment Variation form.  Subject Coordinator approval is NOT required.

